B.Fa=new A.fu("Flutter Planner","assets/mockups/flutter_planner.png","A personal planner app was one of my first app ideas before I started with programming; a simple app that helps people to control their activities, schedule, personal projects, tasks, notes, etc.\n\nSome months ago finally windows support arrived to Flutter, together with my desire to learn about flutter bloc and [supabase](https://supabase.com/); I decided to build Flutter planner.\n\nFlutter Planner is a basic implementation of that initial idea where people can plan their daily activities and see their routines in a timetable.\n\nTogether with the project, I developed [dynamic_timetable](https://pub.dev/packages/dynamic_timeline), a flutter package to create daily timelines, timetables, and in the future Gantt charts, in the process I learned about how are built the widgets and what are render objects.\n    ","https://github.com/IvanHerreraCasas/flutter_planner")
B.Fb=new A.fu("Kotlin SymPy","assets/mockups/kotlin_sympy.png","Sympy app allows to solve complex symbolic mathematical operations using SymPy, a python library.\n\nThe app was build using JetPack compose and the operations are calculated on a local server that was made in python using Flask.",null)
B.Fc=new A.fu("Inventory management","assets/mockups/inventory_management.png","At home my parents have a small store (school supplies), and we always were facing problems, sometimes we didn't know the price or stock of a product, other times we didn't know about sales and purchases of each day. So I decided to create an app to help them.\n        \nInventory management app organize the products in categories and allow add sales and purchases at anytime, updating automatically the stock.\n        \nThe app was builded using firebase.","https://github.com/IvanHerreraCasas/inventory_management_app")
B.Fd=new A.fu("To-Do List","assets/mockups/todo_list.png","The dilemma of a self programmer \u2026 what should I learn now. After debating with myself between design or firebase skills I decided to go with firebase.\n        \nTodo list app is actually a clone of [an app with the same name](https://play.google.com/store/apps/details?id=todolist.scheduleplanner.dailyplanner.todo.reminders&hl=en_US&gl=US), I implemented almost all the important features of that complex to-do application and did some improvements to the login using flutter-fire ui.","https://github.com/IvanHerreraCasas/todo_list_app")
B.Fe=new A.fu("Personal Finance","assets/mockups/personal_finance.png","Personal Finance app was made to help people control their incomes, expenses and schedule their payments.\n\nThe app includes:\n\n- Calendar.\n- Pie charts.\n- Income and expense categories with custom icons and colors.",null)
B.Ff=new A.fu("Anime app","assets/mockups/anime.png","Anime app is a basic clone of [MyAnimeList](https://play.google.com/store/apps/details?id=net.myanimelist.app&hl=es_US&gl=US). \n        \nThere people can find popular, seasonal and airing animes, and watch their details, includes Youtube trailers.\n        \nThe app use [Jikan](https://docs.api.jikan.moe/) to get the data.",null)
B.Fg=new A.fu("Music App","assets/mockups/music_app.png","Some years ago, the first time I heard about programming, web and mobile development I thought it would be nice to create my own custom app. One that use a lot is a music app, so some weeks ago when I remembered it I decided to make one.\n        \nMusic app includes all the features of a music player: play, pause, seek, shuffle, repeat, play in background, etc.\n        \nThe design was inspired by [this beautiful design](https://dribbble.com/shots/9173692-Music-App).","https://github.com/IvanHerreraCasas/music_app")
B.Fh=new A.fu("Kotlin Calculator","assets/mockups/kotlin_calculator.png","Kotlin calculator was my first mobile app, the app is a clone of  [Xiaomi scientific calculator](https://play.google.com/store/apps/details?id=com.miui.calculator&hl=es&gl=US). \n        \nSomething that I like of this app is that it shows the result while you're typing.\n        \nThe motivation was to experiment how is the process of build an app, and get familiarized with Kotlin, read docs, and learn more about strings and their functions.",null)
B.Fi=new A.fu("CookBook","assets/mockups/cookbook.png","After looking at the typical tutorial of a To-Do app, I decided to make my own Flutter app then I realized that a recipes app would be very similar to a To-Do one, so I decided to make CookBook.\n        \nCookbook was my first Flutter app, a beautiful app inspired by [this dribble design](https://dribbble.com/shots/7077306-Recipe-App-Concept), where people can save their own recipes.\n        \nThe app comes with some default Peruvian food, and use sqflite to store the data.",null)
